// Parse GCal event and extract interpreter/org names
 const items = [];

 for (const item of $input.all()) {
   const event = item.json;

   // Extract interpreter name from summary (e.g., "Vietnamese - Mychi PHONE")
   const summaryMatch =
 event.summary?.match(/^([^-]+)\s*-\s*(.+?)\s+(PHONE|ZOOM|IN PERSON)$/i);

   if (!summaryMatch) {
     continue; // Skip events that don't match reminder format
   }

   const language = summaryMatch[1].trim();
   const interpreterName = summaryMatch[2].trim();
   const modality = summaryMatch[3].toUpperCase();

   // Extract org abbreviation from location (e.g., "SLS KIRKLAND")
   const locationParts = event.location?.split(' ') || [];
   const orgAbbreviation = locationParts[0];

   items.push({
     json: {
       gcal_event_id: event.id,
       gcal_event: event,
       interpreter_name: interpreterName,
       org_abbreviation: orgAbbreviation,
       language,
       modality
     }
   });
 }

 return items;

// Build payload for renderer - GCal event format
const items = [];

for (const item of $input.all()) {
  const gcalEvent = item.json.gcal_event;

  // Renderer expects: summary, location, start, end, description
  items.push({
    json: {
      summary: gcalEvent.summary,
      location: gcalEvent.location,
      start: gcalEvent.start,
      end: gcalEvent.end,
      description: gcalEvent.description || ''
    }
  });
}

return items;

